    "contracts/utils/Redeemable.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

/**
 * @dev Contract module which allows children to implement a redeem
 * capability that lets children mark a token (i.e. ERC721) as redeemed.
 *
 * This module is used through inheritance.  Each token will have the
 * default number of redemptions and allow the child contract to increment
 * the tokens redeemed counter until all redemptions are used.
 */
abstract contract Redeemable {
    /// @dev max redemptions default to 1, defaults to 0 after cloning
    uint32 public maxRedemptions = 1;

    /// @dev the redemptions used per token
    mapping(uint256 => uint32) public tokenRedemptions;

    /**
     * @notice event emitted when creating new NFT contracts
     * @param tokenId the ID of the token being redeemed
     * @param count the current number of redemptions
     */
    event Redeem(uint256 indexed tokenId, uint32 count);

    /**
     * @dev set the maximum number of redemptions
     * @param _maxRedemptions the desired maximum number of redemptions
     */
    function _setMaxRedemptions(uint32 _maxRedemptions) internal {
        maxRedemptions = _maxRedemptions;
    }

    /**
     * @dev increment the number of redemptions used by the token
     * @param _tokenId the token to redeem
     * @param _count the number of redemptions to use
     */
    function _redeem(uint256 _tokenId, uint32 _count) internal {
        uint32 currentRedemptions = tokenRedemptions[_tokenId];
        require(
            currentRedemptions + _count <= maxRedemptions,
            "REDEMPTIONS_USED"
        );
        tokenRedemptions[_tokenId] += _count;
        emit Redeem(_tokenId, _count);
    }
}
